tt navigointivalikon luettelolla.</Description><Description language-id=\"en_US\">Displays a navigation menu with a list.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra un men de navegacin con una lista.</Description><Description language-id=\"nl_NL\">Geeft een navigatiemenu weer met een lijst.</Description></root>','display',NULL,'ftl','<#include \"${templatesPath}/NAVIGATION-MACRO-FTL\" />\n\n<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<div aria-label=\"<@liferay.language key=\"site-pages\" />\" class=\"list-menu\">\n		<@buildNavigation\n			branchNavItems=branchNavItems\n			cssClass=\"layouts\"\n			displayDepth=displayDepth\n			includeAllChildNavItems=true\n			navItemLevel=1\n			navItems=entries\n		/>\n	</div>\n</#if>',0,0,33483,NULL,NULL),(0,0,'03b38b5b-b9f2-840a-26b6-d2392b0316f5',33485,20121,20096,20099,NULL,20099,NULL,'2023-09-14 23:14:20.443000','2023-09-14 23:14:20.443000',33481,0,33314,'NAV-PILLS-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Piller horisontellt</Name><Name language-id=\"pt_BR\">Comprimidos horizontais</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Pilules horizontales</Name><Name language-id=\"hu_HU\">Vzszintes tablettk</Name><Name language-id=\"de_DE\">Pills horizontal</Name><Name language-id=\"ca_ES\">Cpsules horitzontals</Name><Name language-id=\"ar_SA\"> </Name><Name language-id=\"fi_FI\">Pills Vaakasuunta</Name><Name language-id=\"en_US\">Pills Horizontal</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Globos horizontales</Name><Name language-id=\"nl_NL\">Horizontale pillen</Name></root>','<?xml version=\'1.0\' encoding=\'U