ry\"\n	>\n		<#if !assetCategoriesSearchFacetDisplayContext.isNothingSelected()>\n			<@clay.button\n				cssClass=\"btn-unstyled c-mb-4 facet-clear-btn\"\n				displayType=\"link\"\n				id=\"${namespace + \'facetAssetCategoriesClear\'}\"\n				onClick=\"Liferay.Search.FacetUtil.clearSelections(event);\"\n			>\n				<strong>${languageUtil.get(locale, \"clear\")}</strong>\n			</@clay.button>\n		</#if>\n\n		<ul class=\"list-unstyled tag-cloud\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<span class=\"facet-value\">\n						<@clay.button\n							cssClass=\"btn-unstyled facet-term ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')} tag-popularity-${entry.getPopularity()} term-name\"\n							data\\-term\\-id=\"${entry.getFilterValue()}\"\n							disabled=\"true\"\n							displayType=\"link\"\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n							style=\"line-height: 1.2;\"\n						>\n							<#if entry.isSelected()>\n								<strong>${htmlUtil.escape(entry.getBucketText())}</strong>\n							<#else>\n								${htmlUtil.escape(entry.getBucketText())}\n							</#if>\n						</@clay.button>\n					</span>\n				</#list>\n			</#if>\n		</ul>\n	</@>\n</@>',0,20099,NULL,'2023-09-14 23:14:17.338000'),(0,0,33320,20121,20096,20099,NULL,'2023-09-14 23:14:17.354000',33313,0,33318,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout compacto</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezs</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposici compacta</Name><Name language-id=\"ar_SA\"> </Name><Name language-id=\"fi_FI\">Tiivis Asettelu</Name><Name language-id=\"en_US\">Compact Layout<