lista.</Description><Description language-id=\"pt_BR\">Exibir categorias por vocabulrios.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Afficher les catgories par vocabulaire.</Description><Description language-id=\"hu_HU\">Kategrik megjelentse a sztrban.</Description><Description language-id=\"de_DE\">Kategorien nach Vokabular anzeigen.</Description><Description language-id=\"ca_ES\">Mostra les categories per vocabulari.</Description><Description language-id=\"ar_SA\">   .</Description><Description language-id=\"fi_FI\">Nyttluokat sanaston mukaan.</Description><Description language-id=\"en_US\">Display categories by vocabulary.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra las categoras por vocabulario.</Description><Description language-id=\"nl_NL\">Categorien weergeven volgens woordenlijst.</Description></root>','ftl','<#macro treeview_item\n	cssClassTreeItem = \"\"\n	frequency = 0\n	id = \"\"\n	frequencyVisible = true\n	name = \"\"\n	selectable = false\n	selected = false\n	termDisplayContexts = \"\"\n>\n	<li class=\"treeview-item\" role=\"none\">\n		<#if name?has_content>\n			<div\n				aria-controls=\"${namespace}treeItem${id}\"\n				aria-expanded=\"true\"\n				class=\"treeview-link ${cssClassTreeItem}\"\n				data-target=\"#${namespace}treeItem${id}\"\n				data-toggle=\"collapse\"\n				onClick=\"${namespace}toggleTreeItem(\'${namespace}treeItem${id}\');\"\n				role=\"treeitem\"\n				tabindex=\"0\"\n			>\n				<span class=\"c-inner\" tabindex=\"-2\">\n					<span class=\"autofit-row\">\n						<#if termDisplayContexts?has_content>\n							<span class=\"autofit-col\">\n								<@clay.button\n									aria\\-controls=\"${namespace}treeItem${id}\"\n									aria\\-expanded=\"true\"\n									cssClass=\"btn btn-monospaced component-expander\"\n									data\\-target=\"#${namespace}treeItem${id}\"\n									data\\-toggle=\"collapse\"\n									displayType=\"link\"\n									tabindex=\"-1\"\n								>\n									<span class=\"c-inner\" tabindex=\"-2\">\n										<@clay[\"icon\"] symbol=\"angle-down\" />\n\n										<@clay[\"icon\"]\n											cssClass=\"component-expanded-d-none\"\n											symbol=\"angle-right\"\n										/>\n									</span>\n								</@clay.button>\n							</span>\n						</#if>\n\n						<#if selectable>\n							<span class=\"autofit-col autofit-col-expand\">\n								<div class=\"custom-checkbox custom-control\">\n									<label>\n										<input\n											autocomplete=\"off\"\n											${selected?then(\"checked\", \"\")}\n											class=\"custom-control-input facet-term\"\n											data-term-id=${id}\n											disabled\n											onChange=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n											type=\"checkbox\"\n										/>\n\n										<span class=\"custom-control-label\">\n											<span class=\"custom-control-label-text\">\n												${name}\n\n												<#if frequencyVisible>\n													(${frequency})\n												</#if>\n											</span>\n										</span>\n									</label>\n								</div>\n							</span>\n						<#else>\n							<span class=\"autofit-col autofit-col-expand\">\n								<span class=\"component-text\">\n									<span\n										class=\"text-truncate-inline\"\n										title=\"${name}\"\n									>\n										<span class=\"text-truncate\">\n											${name}\n\n											<#if frequencyVisible>\n												(${frequency})\n											</#if>\n										</span>\n									</span>\n								</span>\n							</span>\n						</#if>\n					</span>\n				</span>\n			</div>\n		</#if>\n\n		<#if termDisplayContexts?has_content>\n			<div class=\"collapse show\" id=\"${namespace}treeItem${id}\">\n				<ul class=\"treeview-group\" role=\"group\">\n					<#list termDisplayContexts as termDisplayContext>\n						<@treeview_item\n							cssClassTreeItem=\"tree-item-category\"\n							frequency=termDisplayContext.getFrequency()\n							frequencyVisible=termDisplayContext.isFrequencyVisible()\n							id=termDisplayContext.getFilterValue()\n							name=htmlUtil.escape(termDisplayContext.getBucketText())\n							selectable=true\n							selected=termDisplayContext.isSelected()\n						/>\n					</#list>\n				</ul>\n			</div>\n		</#if>\n	</li>\n</#macro>\n\n<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetAssetCategoriesPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<#assign vocabularyNames = assetCategoriesSearchFacetDisplayContext.getVocabularyNames() />\n\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet search-facet-display-vocabulary\"\n		id=\"${namespace + \'facetAssetCategoriesPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${(vocabularyNames?size == 1)?then(vocabularyNames[0]!\'\', \'category\')}\"\n	>\n		<#if !assetCategoriesSearchFacetDisplayContext.isNothingSelected()>\n			<@clay.button\n				cssClass=\"btn-unstyled c-mb-4 facet-clear-btn\"\n				displayType=\"link\"\n				id=\"${namespace + \'facetAssetCategoriesClear\'}\"\n				onClick=\"Liferay.Search.FacetUtil.clearSelections(event);\"\n			>\n				<strong>${languageUtil.get(locale, \"clear\")}</strong>\n			</@clay.button>\n		</#if>\n\n		<#if vocabularyNames?has_content>\n			<ul class=\"treeview treeview-light treeview-nested treeview-vocabulary-display\" role=\"tree\">\n				<#list vocabularyNames as vocabularyName>\n					<@treeview_item\n						cssClassTreeItem=\"tree-item-vocabulary\"\n						frequencyVisible=false\n						id=vocabularyName + vocabularyName?index\n						name=\"${(vocabularyNames?size == 1)?then(\'\', htmlUtil.escape(vocabularyName))}\"\n						termDisplayContexts=assetCategoriesSearchFacetDisplayContext.getBucketDisplayContexts(vocabularyName)\n					/>\n				</#list>\n			</ul>\n		</#if>\n	</@>\n</@>\n\n<@liferay_aui.script>\n	function ${namespace}toggleTreeItem(dataTarget) {\n		const dataTargetElements = document.querySelectorAll(\"[data-target=\\\"#\" + dataTarget + \"\\\"]\");\n\n		dataTargetElements.forEach(\n			element => {\n				if (element.classList.contains(\'collapsed\')) {\n					element.classList.remove(\'collapsed\');\n					element.setAttribute(\'aria-expanded\', true);\n				}\n				else {\n					element.classList.add(\'collapsed\');\n					element.setAttribute(\'aria-expanded\', false);\n				}\n			}\n		);\n\n		const subtreeCategoryTreeElement = document.getElementById(dataTarget);\n\n		if (subtreeCategoryTreeElement) {\n			if (subtreeCategoryTreeElement.classList.contains(\'show\')) {\n				subtreeCategoryTreeElement.classList.remove(\'show\');\n			}\n			else {\n				subtreeCategoryTreeElement.classList.add(\'show\');\n			}\n		}\n	}\n</@>',0,20099,NULL,'2023-09-14 23:14:17.374000'),(0,0,33330,20121,20096,20099,NULL,'2023-09-14 23:14:17.681000',33327,0,33328,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout compacto</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezs</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposici compacta</Name><Name language-id=\"ar_SA\"> </Name><Name language-id=\"fi_FI\">Tiivis Asettelu</Name><Name language-id=\"en_US\">Compact Layout</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Diseo compacto</Name><Name language-id=\"nl_NL\">Compacte lay-out</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en lista med lnkar.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista de links.</Description><Description language-id=\"ja_JP\"></Descripti