 para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>','ftl','<#assign count = 0 />\n\n<div class=\"container-fluid container-fluid-max-xl\" style=\"text-align:center\">\n	<div class=\"row\" style=\"padding:15px\">\n		<#if entries?has_content>\n			<#list entries as curCommerceAddress>\n				<div class=\"col-md-4\" style=\"text-align:left\">\n					<#assign\n						editURL = commerceAddressDisplayContext.getEditCommerceAddressURL(curCommerceAddress.getCommerceAddressId())\n\n						deleteURL = commerceAddressDisplayContext.getDeleteCommerceAddressURL(curCommerceAddress.getCommerceAddressId())\n\n						editButtonValue = languageUtil.get(request, \"edit\")\n\n						removeButtonValue = languageUtil.get(request, \"remove\")\n\n						commerceCountry = curCommerceAddress.getCommerceCountry()\n					/>\n\n					<h2 style=\"color:#000\"><strong>${htmlUtil.escape(curCommerceAddress.getName())}</strong></h2>\n\n					<h3 style=\"color:#000\">${htmlUtil.escape(curCommerceAddress.getStreet1())}</h3>\n\n					<h3 style=\"color:#000\">${htmlUtil.escape(curCommerceAddress.getZip())}, ${htmlUtil.escape(curCommerceAddress.getCity())}</h3>\n\n					<#if commerceCountry??>\n						<h3 style=\"color:#000\">${htmlUtil.escape(commerceCountry.getName(themeDisplay.getLanguageId()))}</h3>\n					</#if>\n\n					<div class=\"row\" style=\"padding-top:30px\">\n						<@liferay_aui.button\n							cssClass=\"btn-lg\"\n							href=\"${editURL}\"\n							name=\"editAddressButton\"\n							value=\"${editButtonValue}\"\n						/>\n\n						<@liferay_aui.button\n							cssClass=\"btn-lg\"\n							href=\"${deleteURL}\"\n							name=\"removeAddressButton\"\n							value=\"${removeButtonValue}\"\n						/>\n					</div>\n				</div>\n\n				<#assign count = count + 1 />\n\n				<#if count gte 3>\n					</div>\n\n					<div class=\"row\" style=\"padding:15px\">\n\n					<#assign count = 0 />\n				</#if>\n			</#list>\n		</#if>\n	</div>\n\n	<div class=\"row\" style=\"padding:50px 0 15px 0\">\n		<#assign addButtonValue = languageUtil.get(request, \"add-address\") />\n\n		<@liferay_aui.button\n			cssClass=\"btn-lg btn-primary\"\n			href=\"${commerceAddressDisplayContext.getAddCommerceAddressURL()}\"\n			name=\"addAddressButton\"\n			value=\"${addButtonValue}\"\n		/>\n	</div>\n</div>',0,20099,NULL,'2023-09-14 23:14:19.453000'),(0,0,33434,20121,20096,20099,NULL,'2023-09-14 23:14:19.514000',33431,0,33432,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Navigering</Name><Name language-id=\"pt_BR\">Navegao</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Navigation</Name><Name language-id=\"hu_HU\">Navigci</Name><Name language-id=\"de_DE\">Navigation</Name><Name language-id=\"ca_ES\">Navegaci</Name><Name language-id=\"ar_SA\"></Name><Name language-id=\"fi_FI\">Navigointi</Name><Name language-id=\"en_US\">Navigation</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Navegacin</Name><Name language-id=\"nl_NL\">Navigatie</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar RSS-fldet som ett navigeringsflt i panelen till vnster. Om du klickar p fldet visas en lista med feedposter i panelen till hger.</Description><Description language-id=\"pt_BR\">Exibe os feeds RSS como uma barra de navegao no painel esquerdo. Clicar em um feed exibe uma lista de entradas de feed no painel direito.</Description><Description language-id=\"ja_JP\">RSS</Description><Description language-id=\"fr_FR\">Affiche les flux RSS en tant que barre de navigation dans le panneau gauche. Cliquer sur un flux affiche une liste d\'entres de flux sur le panneau droit.</Description><Description language-id=\"hu_HU\">Megjelenti az RSS hrcsatornkat navigcis oszlopknt a bal oldalon. Egy hrcsatornra kattintva megjelenti a hrcsatorna bejegyzsek listjt a jobb oldalon.</Description><Description language-id=\"de_DE\">Stellt die RSS-Feeds als Navigationsleiste im linken Bereich dar. Nach Anklicken eines Feeds werden die entsprechenden Feedeintrge im rechten Bereich dargestellt.</Description><Description language-id=\"ca_ES\">Mostra els canals RSS com una barra de navegaci en el tauler esquerra. Al fer un clic en un canal es mostraran la llista d\'entrades en el tauler dret.</Description><Description language-id=\"ar_SA\">  RSS     .             .</Description><Description language-id=\"fi_FI\">Nytt RSS-sytteet navigaatiopalkissa vasemmassa paneelissa. Klikkaamalla sytett nytetn sytteen arvot oikeassa paneelissa.</Description><Description language-id=\"en_US\">Displays the RSS feeds as a navigation bar on the left panel. Clicking on a feed displays a list of feed entries on the right panel.</Description><Description language-id=\"zh_CN\">RSSFeed</Description><Description language-id=\"es_ES\">Muestra las fuentes RSS como una barra de navegacin del panel izquierdo. Al hacer clic en una fuente se muestra una lista de entradas de la fuente en el panel derecho.</Description><Description language-id=\"nl_NL\">Geeft de RSS-feeds als een navigatiebalk in het linkerpaneel weer. Als u op een feed klikt wordt een lijst van van feed-entries in het rechterpaneel getoond.</Description></root>','ftl','<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />\n\n<style>\n	.portlet-rss .feed-entry-content {\n		margin-bottom: 20px;\n		padding-left: 0;\n	}\n</style>\n\n<#if entries?has_content>\n	<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n	<div class=\"container-fluid\">\n		<div class=\"row\" id=\"<@portlet.namespace />feedsTab\">\n			<ul class=\"col-4\">\n				<#list entries as curEntry>\n					<li><a href=\"#tab-${curEntry_index}\">${htmlUtil.escape(curEntry.getTitle())}</a></li>\n				</#list>\n			</ul>\n\n			<div class=\"col-8 tab-content\">\n				<#list entries as curEntry>\n					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />\n\n					<#if rssFeedEntries??>\n						<div class=\"tab-pane\" id=\"tab-${curEntry_index}\">\n							<#list rssFeedEntries as rssFeedEntry>\n								<#if (rssFeedEntry_index >= (entriesPerFeed!4)?number)>\n									<#break>\n								</#if>\n\n								<#assign syndEntry = rssFeedEntry.getSyndEntry() />\n\n								<div class=\"feed-entry-content\">\n									<div class=\"feed-title\">\n										<@liferay_aui[\"a\"] href=\"${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}\">${htmlUtil.escape(syndEntry.getTitle())}</@>\n									</div>\n\n									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>\n										<div class=\"feed-entry-author\">\n											${htmlUtil.escape(syndEntry.getAuthor())}\n										</div>\n									</#if>\n\n									<#if syndEntry.getPublishedDate()??>\n										<div class=\"feed-date\">\n											<@liferay_ui[\"icon\"]\n												icon=\"calendar\"\n												label=true\n												markupView=\"lexicon\"\n												message=\"${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}\"\n											/>\n										</div>\n									</#if>\n\n									${rssFeedEntry.getSanitizedContent()}\n								</div>\n							</#list>\n						</div>\n					</#if>\n				</#list>\n			</div>\n		</div>\n	</div>\n\n	<@liferay_aui[\"script\"] use=\"aui-base,aui-tabview\">\n		new A.TabView(\n			{\n				srcNode: \'#<@portlet.namespace />feedsTab\',\n				stacked: true,\n				type: \'pills\'\n			}\n		).render();\n	</@>\n</#if>',0,20099,NULL,'2023-09-14 23:14:19.514000'),(0,0,33437,20121,20096,20099,NULL,'2023-09-14 23:14:19.598000',20004,0,33435,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout med flera kolumner</Name><Name language-id=\"pt_BR\">Layout em Mltiplas Colunas</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"hu_HU\">Tbb oszlopos elrendezs</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"ar_SA\">  </Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Diseo con varias columnas</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en kolumn fr varje ordlista. Varje kolumn inkluderar namnet p en ordlista med ordlistans toppnivkategorier listade under.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada vocabulrio. Cada coluna inclui o nome do vocabulrio com as categorias de nvel mais alto listadas abaixo dele.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque vocabulaire. Chaque colonne inclut le nom d\'un vocabulaire avec les catgories du niveau racine listes en dessous.</Description><Description language-id=\"hu_HU\">Megjelent egy oszlopot minden sztr szmra. Minden oszlop tartalmazza a sztr nevt, alatta a sztr fels szint kategriival.</Description><Description language-id=\"de_DE\">Stellt eine Spalte fr jedes Vokabular dar. Jede Spalte enthlt den Namen eines Vokabulars mit der obersten Kategorienebene darunter.</Description><Description language-id=\"ca_ES\">Visualitza una columna per a cada vocabulari. Cada columna inclou el nom del vocabulari amb la categoria de nivell ms alta a sota.</Description><Description language-id=\"ar_SA\">   .            .</Description><Description language-id=\"fi_FI\">Nytt sarakkeen jokaiselle sanastolle. Jokainen sarake sislt sanaston nimen, miss sanaston yltason luokitukset on listattu.</Description><Description language-id=\"en_US\">Displays a column for each vocabulary. Each column includes the name of a vocabulary with the vocabulary\'s top level categories listed underneath.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Despliega una columna para cada vocabulario. Cada columna incluye el nombre de un vocabulario con las categoras de mayor nivel del vocabulario listadas debajo.</Description><Description language-id=\"nl_NL\">Toon een kolom voor ieder woordenboek. Iedere kolom bevat de naam van een woordenboek met de hoofd categorien eronder.</Description></root>','ftl','<#assign hasCategories = false />\n\n<#if entries?has_content>\n	<@clay.row>\n		<#list entries as entry>\n			<#assign categories = entry.getCategories() />\n\n			<#if categories?has_content>\n				<#assign hasCategories = true />\n\n				<@clay.col md=\"3\">\n					<div class=\"results-header\">\n						<h3>\n							${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}\n						</h3>\n					</div>\n\n					<@displayCategories categories=categories />\n				</@clay.col>\n			</#if>\n		</#list>\n\n		<#if !hasCategories>\n			${renderRequest.setAttribute(\"PORTLET_CONFIGURATOR_VISIBILITY\", true)}\n\n			<div class=\"alert alert-info w-100\">\n				<@liferay_ui.message key=\"there-are-no-categories\" />\n			</div>\n		</#if>\n	</@clay.row>\n</#if>\n\n<#macro displayCategories\n	categories\n>\n	<#if categories?has_content>\n		<ul class=\"categories\">\n			<#list categories as category>\n				<li>\n					<#assign categoryURL = renderResponse.createRenderURL() />\n\n					${categoryURL.setParameter(\"resetCur\", \"true\")}\n					${categoryURL.setParameter(\"categoryId\", category.getCategoryId()?string)}\n\n					<a href=\"${categoryURL}\">${category.getName()}</a>\n\n					<#if serviceLocator??>\n						<#assign\n							assetCategoryService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetCategoryService\")\n\n							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())\n						/>\n\n						<@displayCategories categories=childCategories />\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,20099,NULL,'2023-09-14 23:14:19.598000'),(0,0,33440,20121,20096,20099,NULL,'2023-09-14 23:14:19.673000',20037,0,33438,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout med flera kolumner</Name><Name language-id=\"pt_BR\">Layout em Mltiplas Colunas</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"hu_HU\">Tbb oszlopos elrendezs</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"ar_SA\">  </Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Diseo con varias columnas</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en kolumn fr varje sida p den hgsta nivn. Varje kolumn inkluderar namnet p varje sida p den hgsta nivn samt sidans omedelbara underordnade element listade under den.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada pgina de nvel superior. Cada coluna inclui o nome de uma pgina de nvel superior com os filhos imediatos da pgina listados abaixo.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque page de niveau suprieur. Chaque colonne comprend le nom d\'une page de niveau suprieur avec les enfants immdiats indiqus en-dessous.</Description><Description language-id=\"hu_HU\">Megjelent egy oszlopot minden fels szint oldalhoz. Mindegyik oszlop tartalmazza a legfels szint oldal nevt, alatta az oldal kzvetlen utdjval.</Description><Description language-id=\"de_DE\">Zeigt eine Spalte fr jede Seite der obersten Ebene. Jede Spalte enthlt den Namen einer Seite der obersten Ebene, darunter werden die direkten Unterseiten aufgelistet.</Description><Description language-id=\"ca_ES\">Mostra una columna per cada pgina de nivell superior. A cada columna, s\'hi inclou el nom d\'una pgina de nivell superior amb el fill immediat de la pgina en una llista a la part inferior.</Description><Description language-id=\"ar_SA\">     .            .</Description><Description language-id=\"fi_FI\">Nytt sarakkeen jokaiselle yltason sivulle. Jokainen sarake sislt yltason sivun nimen ja sivun vlittmt alasivut lueteltuna alapuolella.</Description><Description language-id=\"en_US\">Displays a column for each top level page. Each column includes the name of a top level page with the page\'s immediate children listed underneath.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra una columna por cada pgina de nivel superior. En cada columna, se incluye el nombre de una pgina de nivel superior con el elemento secundario inmediato de la pgina en una lista de la parte inferior.</Description><Description language-id=\"nl_NL\">Geeft een kolom weer voor elke pagina op het hoogste niveau. Elke kolom bevat de naam van een bovenliggende pagina met alle directe onderliggende pagina\'s eronder.</Description></root>','ftl','<#if entries?has_content>\n	<@clay.row>\n		<#list entries as entry>\n			<#if (getterUtil.getBoolean(showHiddenPages) || !entry.isHidden()) && layoutPermission.containsWithoutViewableGroup(permissionChecker, entry, \"VIEW\")>\n				<@clay.col md=\"3\">\n					<div class=\"results-header\">\n						<h3>\n							<a\n\n							<#assign layoutType = entry.getLayoutType() />\n\n							<#if layoutType.isBrowsable()>\n								href=\"${portalUtil.getLayoutURL(entry, themeDisplay)}\"\n							</#if>\n\n							>${entry.getName(locale)}</a>\n						</h3>\n					</div>\n\n					<@displayPages\n						depth=1\n						pages=entry.getChildren(permissionChecker)\n					/>\n				</@clay.col>\n			</#if>\n		</#list>\n	</@clay.row>\n</#if>\n\n<#macro displayPages\n	depth\n	pages\n>\n	<#if pages?has_content && ((depth < displayDepth?number) || (displayDepth?number == 0))>\n		<ul class=\"child-pages\">\n			<#list pages as page>\n				<#if getterUtil.getBoolean(showHiddenPages) || !page.isHidden()>\n					<li>\n						<a\n\n						<#assign pageType = page.getLayoutType() />\n\n						<#if pageType.isBrowsable()>\n							href=\"${portalUtil.getLayoutURL(page, themeDisplay)}\"\n						</#if>\n\n						>${page.getName(locale)}</a>\n\n						<@displayPages\n							depth=depth + 1\n							pages=page.getChildren(permissionChecker)\n						/>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,20099,NULL,'2023-09-14 23:14:19.673000'),(0,0,33444,20121,20096,20099,NULL,'2023-09-14 23:14:19.747000',33441,0,33442,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Ikon</Name><Name language-id=\"pt_BR\">cone</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Icne</Name><Name language-id=\"hu_HU\">Ikon</Name><Name language-id=\"de_DE\">Symbol</Name><Name language-id=\"ca_ES\">Icona</Name><Name language-id=\"ar_SA\"></Name><N