lected active\"\n						/>\n					</#if>\n\n					<li class=\"${nav_item_css_class}\" id=\"layout_${portletDisplay.getId()}_${navItem.getLayoutId()}\" role=\"presentation\">\n						<a ${nav_item_attr_has_popup} class=\"${nav_item_link_css_class}\" ${nav_item_href_link} ${navItem.getTarget()} role=\"menuitem\">\n							<span class=\"text-truncate\"><@liferay_theme[\"layout-icon\"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>\n						</a>\n\n						<#if showChildrenNavItems>\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									navItem=navItem\n								/>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>',0,20099,NULL,'2023-09-14 23:14:20.443000'),(0,0,33490,20121,20096,20099,NULL,'2023-09-14 23:14:20.453000',33481,0,33488,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Piller justerat</Name><Name language-id=\"pt_BR\">Pills justificados</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Pilules justifies</Name><Name language-id=\"hu_HU\">Sorkizrt tablettk</Name><Name language-id=\"de_DE\">Pills justiert</Name><Name language-id=\"ca_ES\">Cpsules justificades</Name><Name language-id=\"ar_SA\"> </Name><Name language-id=\"fi_FI\">Pills Tasattu</Name><Name language-id=\"en_US\">Pills Justified</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Globos justificados</Name><Name language-id=\"nl_