INSERT INTO `Role_` VALUES (0,0,'32ca3040-3dbd-8c4c-92d8-44276686fdd7',20101,20096,20099,NULL,'2023-09-14 23:11:31.760000','2023-09-14 23:11:31.760000',20065,20101,'Administrator',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Administrators are super users who can do anything.</Description></root>',1,NULL),(0,0,'f4744cc4-8ee0-62f1-f6bf-396ad0d4c12b',20102,20096,20099,NULL,'2023-09-14 23:11:31.798000','2023-09-14 23:11:31.798000',20065,20102,'Analytics Administrator',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Analytics Administrators are users who can view data across the company but cannot make changes except to the company preferences.</Description></root>',1,NULL),(0,0,'3247bbcd-55da-1b44-e3f1-195135433579',20103,20096,20099,NULL,'2023-09-14 23:11:31.915000','2023-09-14 23:11:31.915000',20065,20103,'Guest',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Unauthenticated users always have this role.</Description></root>',1,NULL),(0,0,'81f91a4e-0c50-bcd2-f17a-e48b4f96b41b',20104,20096,20099,NULL,'2023-09-14 23:11:31.934000','2023-09-14 23:11:31.934000',20065,20104,'Owner',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">This is an implied role with respect to the objects users create.</Description></root>',1,NULL),(0,0,'182ad064-156f-e951-6d1b-c16faf6dbcc1',20105,20096,20099,NULL,'2023-09-14 23:11:31.951000','2023-09-14 23:11:31.951000',20065,20105,'Power User',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Power Users have their own personal site.</Description></root>',1,NULL),(0,0,'2335460f-fe29-b