in that organization.</Description></root>',3,NULL),(0,0,'b3052529-f1a7-4fe4-9f7e-a32776b05921',20111,20096,20099,NULL,'2023-09-14 23:11:32.070000','2023-09-14 23:11:32.070000',20065,20111,'Site Administrator',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Site Administrators are super users of their site but cannot make other users into Site Administrators.</Description></root>',2,NULL),(0,0,'af4cbebc-5dae-d3b7-1e21-166b46a79863',20112,20096,20099,NULL,'2023-09-14 23:11:32.083000','2023-09-14 23:11:32.083000',20065,20112,'Site Member',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">All users who belong to a site have this role within that site.</Description></root>',2,NULL),(0,0,'491b50f7-c1dd-b941-fc69-3c0bf6fe2206',20113,20096,20099,NULL,'2023-09-14 23:11:32.095000','2023-09-14 23:11:32.095000',20065,20113,'Site Owner',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Site Owners are super users of their site and can assign site roles to users.</Description></root>',2,NULL),(0,0,'501cfbd5-c349-1b5c-4c79-93d827e3ae3c',20137,20096,20099,NULL,'2023-09-14 23:11:35.581000','2023-09-14 23:11:35.581000',20065,20137,'Asset Library Administrator',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Administratrer av tillgngsbibliotek r superanvndare av sitt tillgngsbibliotek, men kan inte gra andra anvndare till administratrer i tillgngsbiblioteket.</Description><Description language-id=\"pt_BR\">Os Administradores da Biblioteca de Ativos so super usurios da biblioteca de ativos, mas no podem tornar outros usurios Administradores da Biblioteca de Ativos.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Les administrateurs d\'un dpt sont des super utilisateurs de leur dpt, mais ne peuvent rendre administrateurs d\'autres utilisateurs.</Description><Description language-id=\"hu_HU\">Az adattr adminisztrtorai adattruk magasabbrend felhasznli, de nem nevezhetnek ki ms felhasznlkat az adattr adminisztrtoraiv.</Description><Description language-id=\"de_DE\">Repository-Administratoren sind Administratoren ihres Repositorys, knnen aber andere Benutzer nicht zu Repository-Administratoren machen.</Description><Description language-id=\"ca_ES\">Els administradors de la biblioteca de continguts sn superusuaris de la seva biblioteca de continguts, per no poden assignar el rol d\'administrador de biblioteca de continguts a altres usuaris.</Description><Description language-id=\"ar_SA\">                  .</Description><Description language-id=\"fi_FI\">Sisltkirjaston Pkyttjt ovat sisltkirjastonsa superkyttji, mutta eivt voi tehd muista kyttjist Sisltkirjaston Pkyttji.</Description><Description language-id=\"en_US\">Asset Library Administrators are super users of their asset library but cannot make other users into Asset Library Administrators.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Los administradores del repositorio son superusuarios de su repositorio, pero no pueden convertir a otros usuarios en administradores del repositorio.</Description><Description language-id=\"nl_NL\">Assetbibliotheekbeheerders zijn supergebruikers van hun assetbibliotheek, maar kunnen geen assetbibliotheekbeheerders maken van andere gebruikers.</Description></root>',5,NULL),(0,0,'542b2388-35d5-1b31-1c14-192e54ea2441',20138,20096,20099,NULL,'2023-09-14 23:11:35.591000','2023-09-14 23:11:35.591000',20065,20138,'Asset Library Connected Site Member',NULL,'',5,NULL),(0,0,'879c2563-4187-4093-3cbf-759d4ba6d054',20139,20096,20099,NULL,'2023-09-14 23:11:35.599000','2023-09-14 23:11:35.599000',20065,20139,'Asset Library Content Reviewer',NULL,'',5,NULL),(0,0,'cc73657a-2d0d-fe5a-e01c-eaf1779ba0f8',20140,20096,20099,NULL,'2023-09-14 23:11:35.608000','2023-09-14 23:11:35.608000',20065,20140,'Asset Library Member',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Alla anvndare som tillhr ett tillgngsbibliotek har den hr rollen i det tillgngsbiblioteket.</Description><Description language-id=\"pt_BR\">Todos os usurios que pertencem a uma biblioteca de ativos possuem esta funo nessa biblioteca de ativos.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Tous les utilisateurs qui appartiennent  un dpt ont ce rle au sein de ce dpt.</Description><Description language-id=\"hu_HU\">Egy adattrhoz tartoz sszes felhasznl ezzel a szerepkrrel rendelkezik az adattron bell.</Description><Description language-id=\"de_DE\">Alle Benutzer, die zu einem Repository gehren, haben diese Rolle innerhalb dieses Repositorys inne.</Description><Description language-id=\"ca_ES\">Tots els usuaris que pertanyin a una biblioteca de continguts tenen aquest rol en aquesta biblioteca de continguts.</Description><Description language-id=\"ar_SA\">              .</Description><Description language-id=\"fi_FI\">Kaikilla kyttjill, jotka kuuluvat sisltkirjastoon, on tm rooli kyseisen sisltkirjaston sisll.</Description><Description language-id=\"en_US\">All users who belong to an asset library have this role within that asset library.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Todos los usuarios que pertenecen a un repositorio tienen este rol en ese repositorio.</Description><Description language-id=\"nl_NL\">Alle gebruikers die bij een assetbibliotheek horen, hebben deze rol in die assetbibliotheek.</Description></root>',5,NULL),(0,0,'2f0a1b41-b934-4d10-ef1d-46769e8fb812',20141,20096,20099,NULL,'2023-09-14 23:11:35.617000','2023-09-14 23:11:35.617000',20065,20141,'Asset Library Owner',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Administratrer av tillgngsbibliotek r superanvndare av sitt tillgngsbibliotek och kan tilldela roller i tillgngsbiblioteket till anvndare.</Description><Description language-id=\"pt_BR\">Os Proprietrios de Bibliotecas de Ativo so super usurios de suas bibliotecas de ativo e podem atribuir funes da biblioteca de ativos a outros usurios.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Les propritaires d\'un dpt sont des super utilisateurs de ce dpt et peuvent affecter des rles  des utilisateurs.</Description><Description language-id=\"hu_HU\">Az adattr tulajdonosai adattruk magasabbrend felhasznli, s adattr szerepkrket rendelhetnek hozz ms felhasznlkhoz.</Description><Description language-id=\"de_DE\">Besitzer von Assetbibliotheken sind Administratoren ihrer Assetbibliothek und knnen Benutzern Assetbibliothek-Rollen zuweisen.</Description><Description language-id=\"ca_ES\">Els propietaris de la biblioteca de continguts sn superusuaris de la seva biblioteca de continguts, i poden assignar rols de la biblioteca de continguts als usuaris.</Description><Description language-id=\"ar_SA\">                .</Description><Description language-id=\"fi_FI\">Sisltkirjaston Omistajat ovat sisltkirjastonsa superkyttji, ja voivat liitt sisltkirjaston rooleja kyttjille.</Description><Description language-id=\"en_US\">Asset Library Owners are super users of their asset library and can assign asset library roles to users.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Los propietarios de repositorio son superusuarios de su repositorio y pueden asignar roles de repositorio a otros usuarios.</Description><Description language-id=\"nl_NL\">Assetbibliotheekeigenaars zijn supergebruikers van hun assetbibliotheek en kunnen assetbibliotheekrollen toewijzen aan gebruikers.</Description></root>',5,NULL),(1,0,'da53b372-2d17-7703-a3db-22355e63a5e5',32314,20096,20099,NULL,'2023-09-14 23:13:30.765000','2023-09-14 23:13:30.771000',32310,32315,'Account Member',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">All users who belong to an account have this role within that account.</Description></root>',6,NULL),(1,0,'20307398-e55c-8651-6601-481e2a014104',32316,20096,20099,NULL,'2023-09-14 23:13:30.784000','2023-09-14 23:13:30.791000',32310,32317,'Account Administrator',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Account Administrators are super users of their account.</Description></root>',6,NULL),(0,0,'3606afae-95e0-813d-21b1-aa5242f39dcb',32318,20096,20099,NULL,'2023-09-14 23:13:30.800000','2023-09-14 23:13:30.800000',20065,32318,'Account Manager',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Account Managers who belong to an organization can administer all accounts associated to that organization.</Description></root>',3,NULL),(0,0,'c11bbe29-3797-86a3-d0bc-ca771e52c3d2',32755,20096,20099,NULL,'2023-09-14 23:13:42.486000','2023-09-14 23:13:42.486000',20065,32755,'Portal Content Reviewer',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">This is an autogenerated role from the workflow definition.</Description></root>',1,NULL),(0,0,'79a5574d-852e-3c34-376f-e4291161e195',32758,20096,20